import React, { Component } from "react";
import Input from "../../common/Input";
import { Avatar } from "@mui/material";
import "../../css/inpu.css";

class Student_Signup extends Component {
  state = {
    account: {
      email: "",
      password: "",
      firstname: "",
      lastname: "",
      phoneno: "",
      religion: "",
      matric_marks: "",
      inter_marks: "",
      father_income: "",
      total_matric_marks: "",
      total_inter_marks: "",
      address: "",
    },
  };

  handletype = (e) => {
    const account = { ...this.state.account };
    if (e.currentTarget.name === "gender") {
      account["gender"] = e.currentTarget.value;
    } else {
      account[e.currentTarget.name] = e.currentTarget.value;
    }

    this.setState({ account });
  };

  handlesubmit = (e) => {
    e.preventDefault();

    // Prepare the data to be sent in the API request
    const data = {
      Email: this.state.account.email,
      Password: this.state.account.password,
      FirstName: this.state.account.firstname,
      LastName: this.state.account.lastname,
      Phoneno: this.state.account.phoneno,
      Religion: this.state.account.religion,
      TotalMatricMarks: this.state.account.matric_marks,
      ObtainedInterMarks: this.state.account.inter_marks,
      FatherIncome: this.state.account.father_income,
      TotalMatricMarks: this.state.account.total_matric_marks,
      TotalInterMarks: this.state.account.total_inter_marks,
      Address: this.state.account.address,
    };

    // Make the API request to save the data in the database
    fetch("http://localhost:5000/api/student/signup", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    })
      .then((response) => response.json())
      .then((result) => {
        console.log("API response:", result);
        // Handle the response as needed
        // Open a new page after the data is saved in the database
        window.open("/progress", "_blank");
      })
      .catch((error) => {
        console.error("API error:", error);
        // Handle the error as needed
      });
  };

  render() {
    return (
      <div className="fluid-container pt-4 signup_container">
        <div className="shadow ps-1 m-5 bg-white signupform_radius">
          <div className="row">
            <div className="col-sm-5 signupform_leftside">
              <Avatar
                className="m-5"
                sx={{ width: 230, height: 230 }}
                src="images/signup.png"
              />

              <h2 className="mt-3 signupHeading">Let's Get You Set Up </h2>
              <p className="mt-2 signupPtag">
                It should take only a couple of minutes to pair with your
                watch
              </p>
            </div>

            <div id="form-col" className="col-sm-7 signupform_rightside">
              <form id="form" onSubmit={this.handlesubmit}>
                <Input
                  label="First Name"
                  value={this.state.account.firstname}
                  name="firstname"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Last Name"
                  value={this.state.account.lastname}
                  name="lastname"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Email Address"
                  value={this.state.account.email}
                  name="email"
                  type="email"
                  onchange={this.handletype}
                />

                <Input
                  label="Phone Number"
                  value={this.state.account.phoneno}
                  name="phoneno"
                  type="tel"
                  onchange={this.handletype}
                />

                <Input
                  label="Password"
                  value={this.state.account.password}
                  name="password"
                  type="password"
                  onchange={this.handletype}
                />

                <Input
                  label="Religion"
                  value={this.state.account.religion}
                  name="religion"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Matriculation Marks"
                  value={this.state.account.matric_marks}
                  name="matric_marks"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Intermediate Marks"
                  value={this.state.account.inter_marks}
                  name="inter_marks"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Father's Income"
                  value={this.state.account.father_income}
                  name="father_income"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Total Matriculation Marks"
                  value={this.state.account.total_matric_marks}
                  name="total_matric_marks"
                  type="text"
                  onchange={this.handletype}
                />

                <Input
                  label="Total Intermediate Marks"
                  value={this.state.account.total_inter_marks}
                  name="total_inter_marks"
                  type="text"
                  onchange={this.handletype}
                />

                <div className="mb-3">
                  <label className="form-label">Address</label>
                  <textarea
                    className="form-control"
                    name="address"
                    value={this.state.account.address}
                    onChange={this.handletype}
                  ></textarea>
                </div>

                <div className="form-check mb-3">
                  <input
                    className="form-check-input"
                    type="checkbox"
                    value=""
                    id="flexCheckDefault"
                  />
                  <label
                    className="form-check-label"
                    htmlFor="flexCheckDefault"
                  >
                    I agree to the terms & conditions
                  </label>
                </div>

                <button
                  type="submit"
                  className="btn btn-primary"
                  onClick={this.handlesubmit}
                >
                  Submit
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Student_Signup;
